    data: |
      SELECT ( + 45 ) * COUNT ( * ) + MIN ( - 67 ) AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( col2 * - col0 ) IN ( + col2 );
  - name: tab1

outputs:
  - name: q3116.out
    data: |
      68
